package Lec511jan;
import java.util.Scanner;

public class naturalnumforloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner s = new Scanner(System.in);
		
		int n = s.nextInt();
		
		for (int i =1;i<=n;i++) {
			System.out.println(i);
		}
		
		
		

	}

}
